</ul>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6acb6551-c1e7-47c8-b928-92a72ca739fc\"},\"title\":\"Concepts to Learn\"},{\"content\":{\"params\":{\"text\":\"<p><em>At the end of this lesson, pupils will be able to:</em></p>\\n\\n<ol>\\n\\t<li><span><span><span><span><span><span>Identify different file types and their use/s,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Locate stored files,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Open and Import files of different types,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Save files in a planned folder structure,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Save files using proper names,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Save files in printable formats,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Save and export data into file formats,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>Explain the need to reduce file sizes,</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span>Reduce file sizes using file compression.</span></span></span></span></li>\\n</ol>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4ef7042b-1df7-4f3d-943d-70f3f5826c64\"},\"title\":\"Learning Outcomes\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Lesson Overview\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Lesson Overview\"},\"subContentId\":\"e237baf5-859c-47a5-a018-aa63231987c5\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h2><strong>The Big Picture</strong></h2>\\n\\n<p>Filing helps you find things. Without filing, you would just have a pile of unsorted papers, and trying to find something in a mess like that can be extremely frustrating!</p>\\n\\n<p>Files are even more essential to how a computer works. Documents and images you create, the software you use, and even the computer’s operating system are all stored as files and folders on your computer. Computer systems can have hundreds of thousands or even millions of files stored on them, making file management important for organisations. It is therefore essential that you know how to locate, name, open, save and print files to get the most out of your computer system. This subtopic will help you develop the practical skills to manage files on your computer.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1199c632-ed61-4ff7-870f-ac4fced1de50\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4QC8RXhpZgAASUkqAAgAAAAGABIBAwABAAAAAQAAABoBBQABAAAAVgAAABsBBQABAAAAXgAAACgBAwABAAAAAgAAABMCAwABAAAAAQAAAGmHBAABAAAAZgAAAAAAAACQAAAAAQAAAJAAAAABAAAABgAAkAcABAAAADAyMTABkQcABAAAAAECAwAAoAcABAAAADAxMDABoAMAAQAAAP//AAACoAQAAQAAAEALAAADoAQAAQAAANACAAAAAAAA/+EOAGh0dHA6Ly9ucy5hZG9iZS5jb20veGFwLzEuMC8APD94cGFja2V0IGJlZ2luPSfvu78nIGlkPSdXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQnPz4KPHg6eG1wbWV0YSB4bWxuczp4PSdhZG9iZTpuczptZXRhLyc+CjxyZGY6UkRGIHhtbG5zOnJkZj0naHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyc+CgogPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9JycKICB4bWxuczpBdHRyaWI9J2h0dHA6Ly9ucy5hdHRyaWJ1dGlvbi5jb20vYWRzLzEuMC8nPgogIDxBdHRyaWI6QWRzPgogICA8cmRmOlNlcT4KICAgIDxyZGY6bGkgcmRmOnBhcnNlVHlwZT0nUmVzb3VyY2UnPgogICAgIDxBdHRyaWI6 anges\":[],\"extraTitle\":\"Untitled Collage\"},\"subContentId\":\"c7d01e7f-b813-4922-9ce8-3b4863657990\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Figure 1. </strong>File Manager</p>\\n\\n<strong>Opening and importing files</strong>\\n\\n<p>In most computer systems, opening a file is as simple as double-clicking on it. This will cause the file to open in the program normally used to edit that file – for example, a word processor for documents or a graphics editor for images.</p>\\n\\n<p>Some computer systems will have more than one program capable of opening a certain type of file. For example, an image editor and a web design program may both be capable of opening image files. Most operating systems provide the option to decide which program is used to open a file when it is clicked (this is known as setting <strong>default</strong> programs), or you can choose each time by right-clicking the file.</p>\\n\\n<p> </p>\\n\\n<h2><strong>Saving files in a hierarchical directory structure</strong></h2>\\n\\n<p>As explained above, most computer systems allow folders and subfolders to be created in a hierarchical structure. A hierarchy is useful because it allows files to be grouped by very general categories at first, and then more specific categories later. For example, we might have a hierarchy structured as shown in Figure<strong> 2</strong> below. The top-level folder, ‘Lucy’s Files’, makes it clear that all subfolders and files within this belong to Lucy. As you move down the hierarchy the folders become more specific – there is one folder for school work and one for personal files. The ‘School’ subfolder is further divided into subjects, and the ‘ICT’ subfolder is even divided into topics. This makes it very easy to organise and locate files without having to use long filenames to explain where they belong or what they contain.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentTyp be the contents of the file at all. A better name might be ‘Job application to Big Enterprise’ or ‘Science Homework – Forces quiz’, which describes the file contents at a glance.</p>\\n\\n<p>Note: It is recommended not to change the file extension (e.g. .jpg or .doc) of a file as this may cause the computer to attempt to open the file with the wrong program. Changing the extension of a file does <strong>not </strong>change its file type, only which programs will try to open the file.</p>\\n\\n<h2><strong>Printing files</strong></h2>\\n\\n<p>Most programs have built-in printing functions, including print previews that enable you to see exactly how an image will look once printed. Additionally, some files (such as images) can be printed directly from the operating system.</p>\\n\\n<p>Web pages can be printed in two different ways:</p>\\n\\n<p>The web page itself can be printed as it appears on the screen in your web browser, including all colours, graphics and text. This is the most commonly used option and is useful for web pages found during your research.</p>\\n\\n<p>However, it is also possible to print the source view or HTML view of a web page. This will print the code that was used by the web developers to create the page. Viewing the HTML of a web page is most useful for website developers who are trying to update or fix problems.</p>\\n\\n<p>The first instructional video below shows you how to carry out basic file management tasks, including opening and saving files and working with folders and filenames.</p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d7f228da-3e06-4e1f-b04d-23dac1ccb66b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Video\",\"loading\":\"Video player loading...\",\"noPlayer ending them to your friend.</p>\\n\\n<p>Note that using alternative file formats may result in some data being lost. For example, if your document uses some of the newer features in the latest version of Word, those features might not be available when you export your document as Word 97-2003 format. However, sometimes this compromise is necessary to be able to open files on different systems.</p>\\n\\n<p>Common file formats for saving and exporting files in specific applications are shown in <strong>Table 1</strong> below.</p>\\n\\n<p> </p>\\n\\n<p style=\\\"text-align:center\\\"><strong>Table 1.</strong> Common Specific File Formats</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"edf330a0-fb71-4d52-8225-d0bfef85aeed\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<table align=\\\"center\\\" border=\\\"1\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\" style=\\\"width:600px\\\">\\n\\t<tbody>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>Data Type</strong></td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>File Extension(s)</strong></td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>Description</strong></td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Documents</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">\\n\\t\\t\\t<div>.docx</div>\\n\\n\\t\\t\\t<div>.doc</div>\\n\\n\\t\\t\\t<div>.rtf</div>\\n\\t\\t\\t</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">These are file formats used to save documents created by word processing applications such as Microsoft Word or LibreOffice Writer. In addition to saving text, these file formats also store formatting information (such as alignment and font) and can also contain embedded images.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Spreadsheets</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">\\n\\t\\t\\t<div>.xlsx</div>\\n\\n\\t\\t\\t<div>.xls</div>\\n\\t\\t\\t</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">These are file formats used to save spreadsheets created by applications such as Excel or LibreOffice Calc. They are used to store numerical data and formula to perform calculations.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Databases</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">\\n\\t\\t\\t<div>.sdb</div>\\n\\n\\t\\t\\t<div>.sdc</div>\\n\\n\\t\\t\\t<div>.adddb</div>\\n\\n\\t\\t\\t<div>.obd</div>\\n\\t\\t\\t</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">These are file formats used to save databases created by applications such as Microsoft Access or Base. Databases contain large amounts of linked data, such as a list of customers and the products they have bought.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Presentations</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">\\n\\t\\t\\t<div>.pptx</div>\\n\\n\\t\\t\\t<div>.ppt</div>\\n\\t\\t\\t</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">These are file formats used to save presentations created by applications such as Microsoft PowerPoint. They typically store data in the form of slides, which can contain images and text.</td>\\n\\t\\t</tr>\\n\\t</tbody>\\n</table>\\n\\n<div style=\\\"text-align:center\\\"> </div>\\n\"},\"library\":\"H5P.Table 1.1\",\"metadata\":{\"contentType\":\"Table\",\"license\":\"U\",\"title\":\"Untitled Table\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Table\"},\"subContentId\":\"24d97e15-44cd-4a4d-bd8e-645ab39a1e4f\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h2><strong>Generic file formats</strong></h2>\\n\\n<p>Some file formats are proprietary, meaning the company or organisation that invented the format does not openly share details about how the format works. This makes it more difficult for other people to create software that reads and writes data in that file format. Examples of these formats include older Microsoft Office files such as .doc documents and .xls spreadsheets.</p>\\n\\n<p>In contrast, generic file formats are well-publicised formats that enable anyone to create software that can read and write them. Generic file formats make it very easy to transfer information between different operating systems, different applications, and even different types of applications.</p>\\n\\n<p>For example, if one user creates an image using Adobe Photoshop on their computer and wishes to send it to another user with a different image editing program, JPEG would be an ideal file format to use because almost all image editors can open such files.</p>\\n\\n<p>Sometimes you may want to transfer data between different types of applications – for example from a spreadsheet to a database program. In these cases, you can use formats such as CSV (Comma Separated Values) files, which take the raw data from the original application and save it in a generic text file. You can see an example of a CSV file in <strong>Figure 1</strong>.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9c11a1be-2868-4691-9a8a-7d5aff7cfcbd\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAo4AAAHRCAIAAABrXK8IAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAOATSURBVHhe7f19cKXHedgLHoxk6/PeiEo2MZ29qWsSAK2ZcRSbUe0OZmrvrXUoCwA3HHk9qPvP7jCbGgBR1RIAi3RVxPlj/xg6WyFrAHD3ageY8lpTyR9bmFx7uB7gKKJdtVuZj6qromxH4OgSgKRssisqqUQaSo4tWZ7BPh/98XS/3e/H+QDOwTy/Igfn9Ntv99NPP91Pd7/v6R7Z2NhoKYqiKIoyqKCrPnfunPmmKIqiKMogcf369WPmo6IoiqIoA4m6akVRFEUZaNRVK4qiKMpAo65aURRFUQYaddWKoiiKMtA0cNX/p//r1ZJ/FUVRFEXpB7Vc9f+w+//7tf/tfzf567/+2bO/8d/8b56Df3/lc9Pw79j/+tfg3//i705cvv0n// +s6NLpQEOr3cG6t/vAqKtWFEVRlIFGXbWiKIqiHCZuubv4gVFXrQwo+sbK4DOYdaSWczCong8SfAPcfFQURVEUZdBotf7/tJz9+gzucfgAAAAASUVORK5CYII=\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":654,\"height\":465}},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"537d1330-4620-4b9b-b010-d9d3e9eaa7d6\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Figure 1</strong>. A CVS File</p>\\n\\n<p>Information about various generic file formats is shown in the series of interactive lists below.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f78ae035-25ad-44cb-befa-f29385180947\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"panels\":[{\"content\":{\"params\":{\"text\":\"<p><strong>File extensions: .jpg, .jpeg</strong></p>\\n\\n<p>JPEG is a very common file format for storing photographs and other images. JPEG uses<strong> lossy compression</strong> to reduce the size of a file, which can sometimes cause a reduction in the quality of an image.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"b8c8d454-4261-4d23-a640-61488dc420b7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"JPEG (Joint Photographic Expert Group)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .png</strong></p>\\n\\n<p>PNG is another very common image file format. It is often used for non-photographic images such as diagrams. PNG uses <strong>lossless compression</strong>, which means the files are larger than JPEG files, but this ensures that no quality is lost.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"e0e1d0eb-78db-4052-8bf1-a218ddfe7f45\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"PNG (Portable Network Graphics)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .gif</strong></p>\\n\\n<p>GIF is an older file format for storing images, which was very popular in the early days of the World Wide Web. More recently GIF files have become popular for storing short animated images. A major drawback of the GIF format is that it is limited to 256 colours.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"56b5f93d-93bf-424e-a3c1-33d25323a9c8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"GIF (Graphical Interchange Format)\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Untitled Accordion\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Accordion\"},\"subContentId\":\"43ea69a4-1393-40b9-a10c-1bbeb2cf9db0\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Accordion 1. </strong>File Format for Images</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c5dcf43a-706b-4434-8e3b-7d26cf13d985\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"panels\":[{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .avi</strong></p>\\n\\n<p>An older format for video.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"2a1bc64f-7b00-47b6-b855-ae504587be7c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"AVI (Audio Video Interleave)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extensions: .mov, .qt</strong></p>\\n\\n<p>A common format for films, often used by Apple devices.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"5a840e35-aed3-4b4a-9432-93dc075af29e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"QuickTime\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .mp4</strong></p>\\n\\n<p>A common, modern format for video.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"7370e05a-9f9c-42cf-9e48-0d71e319ae7e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"MP4 (Motion Picture Experts Group)\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Untitled Accordion\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Accordion\"},\"subContentId\":\"bfdf5759-f5d4-4e9a-9e6f-3c3a78994b8b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Accordion 2. </strong>File Format for Video</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"805656c9-9299-40b3-98d5-f8deb3833106\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"panels\":[{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .csv</strong></p>\\n\\n<p>A text file format that separates data fields using commas and new lines. Used for importing text into spreadsheets or databases.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"59576e41-c381-4db4-8c45-e8154ca0cb36\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"CSV (Comma Separated Values)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .txt</strong></p>\\n\\n<p>A plain text format capable of storing text characters but no formatting information or other features.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"b8cf9b1b-25c0-4b00-9e91-c4eff4f6f3ae\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"Text\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .rtf</strong></p>\\n\\n<p>A format capable of storing text plus basic formatting information such as fonts, spacing, text colours and images.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"9f446223-3cb9-4a26-9c7b-d665e9dc0aea\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"RTF (Rich Text Format)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extensions: .html, .htm</strong></p>\\n\\n<p>A text format which is used for writing code to describe the layout of pages on the World Wide Web.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"128c4909-caa9-4487-afc7-d5466fb21501\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"HTML (Hypertext Markup Language\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .css</strong></p>\\n\\n<p>A text format that is usually used alongside HTML to describe how a web page should be formatted (colours, fonts, etc.).</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"486f4678-3de9-47ff-95fd-de0a1ef7317b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"CSS (Cascading Style Sheets)\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .pdf</strong></p>\\n\\n<p>A very common file format used by many programs to export professional looking documents which maintain their layout and formatting just as they would appear when printed, and regardless of the software used to open them.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"c4000c3a-f744-4a48-8e7b-7e37153c94ef\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"PDF (Portable Document Format)\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Untitled Accordion\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Accordion\"},\"subContentId\":\"8e21b87a-8c92-446c-94bd-f99474319157\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Accordion 3. </strong>File Formats for Text and Data</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e68529ad-3af4-4a96-9439-539356895fd1\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"panels\":[{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .zip</strong></p>\\n\\n<p>A very common general purpose compressed format. Many programs available for download from the internet use the ZIP file format.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"bb9b6a52-3a25-486b-b92b-008136228348\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"ZIP\"},{\"content\":{\"params\":{\"text\":\"<p><strong>File extension: .rar</strong></p>\\n\\n<p>A general purpose compressed format which is not quite as popular or common as ZIP.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"b5f46789-6fce-4521-892b-08a88076fc98\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"RAR\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Untitled Accordion\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Accordion\"},\"subContentId\":\"2efe1b02-2bb0-4207-8e5a-85e0f6611aa0\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Accordion 4. </strong>Compressed File Formats</p>\\n\\n<p>You might wonder why all software does not just use generic file formats. The answer is that generic file formats may lack the specific features needed by some software. For example, early versions of the Rich Text Format (RTF) did not support drawings in documents. This means a company developing a word processing application that needed these features would need to use a different file format, or possibly develop their own. Similarly, programs such as Photoshop support complex features such as image layers and image history. However, JPEG and PNG file formats cannot save this information, so Photoshop uses its own file format (PSD – Photoshop Document).</p>\\n\\n<p>Many applications can export their data in generic formats. However, you should note that once data is exported in a generic format, a lot of functionality may be lost and re-importing that generic file back into your application software will not restore that functionality.</p>\\n\\n<p>For example, it is possible to export slides from presentation software such as PowerPoint as JPEG images. This is very useful because JPEG is a generic file format that most computers can open. Therefore you can view the contents of the slides even if the destination computer does not have PowerPoint installed. However, the exported JPEG images can no longer be edited as slides can – it will no longer be possible to move objects, change fonts, add or delete slides, add transitions, and so on. The slides have been exported as static images. Only by opening the original PowerPoint document again can these changes be made.</p>\\n\\n<p>(Note: this is why it is always a good idea to keep your original application files in addition to any generic exported files.)</p>\\n\\n<p>This instructional video explores file formats further.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"89e06605-23f1-4260-9bfc-a4ee21d428ca\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Video\",\"loading\":\"Video player loading...\",\"noPlayers\":\"Found no video players that supports the given video format.\",\"noSources\":\"Video is missing sources.\",\"aborted\":\"Media playback has been aborted.\",\"networkFailure\":\"Network failure.\",\"cannotDecode\":\"Unable to decode media.\",\"formatNotSupported\":\"Video format not supported.\",\"mediaEncrypted\":\"Media encrypted.\",\"unknownError\":\"Unknown error.\",\"invalidYtId\":\"Invalid YouTube ID.\",\"unknownYtId\":\"Unable to find video with the given YouTube ID.\",\"restrictedYt\":\"The owner of this video does not allow it to be embedded.\"},\"sources\":[{\"path\":\"https://eu-west-1.cdn.h5p.com/orgs/1291027060549476357/organization/content/1291445265134555757/videos/files-6156df71b53dd.mp4?ver=origin\",\"mime\":\"video/mp4\",\"copyright\":{\"license\":\"U\"}}]},\"library\":\"H5P.Video 1.6\",\"metadata\":{\"contentType\":\"Video\",\"license\":\"U\",\"title\":\"Untitled Video\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Video\"},\"subContentId\":\"c606f1f2-e522-4c24-b99f-bf5762d814c5\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Instructional Video 3. </strong>File Formats</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5a7bc459-b889-4a86-a1b4-c69425e0e4b7\"},\"useSepara
